var mendixmodelsdk_1 = require("mendixmodelsdk");
function createSmallDomainModel(root) {
    // new module:
    var module1 = mendixmodelsdk_1.projects.Module.createIn(root);
    module1.name = "Module_1";
    // new domainmodel:
    var domainModel = mendixmodelsdk_1.domainmodels.DomainModel.createIn(module1);
    // new entity:
    var entity1 = mendixmodelsdk_1.domainmodels.Entity.createIn(domainModel);
    entity1.name = "Entity_1";
    // new attributes:
    var attribute1 = mendixmodelsdk_1.domainmodels.Attribute.createIn(entity1);
    attribute1.name = "Attribute_1";
    attribute1.type = mendixmodelsdk_1.domainmodels.FloatAttributeType.createIn(attribute1);
    var attribute2 = mendixmodelsdk_1.domainmodels.Attribute.createIn(entity1);
    attribute2.name = "Attribute_2";
    var attribute3 = mendixmodelsdk_1.domainmodels.Attribute.createIn(entity1);
    attribute3.name = "Attribute_3";
    attribute3.type = mendixmodelsdk_1.domainmodels.DateTimeAttributeType.createIn(attribute3);
    attribute3.type.localizeDate = false;
    // new entity:
    var entity2 = mendixmodelsdk_1.domainmodels.Entity.createIn(domainModel);
    entity2.name = "Entity_2";
    // new (regular) association:
    var association = mendixmodelsdk_1.domainmodels.Association.createIn(domainModel);
    association.name = "Association_1";
    association.parent = entity1;
    association.child = entity2;
    association.type = mendixmodelsdk_1.domainmodels.AssociationType.ReferenceSet;
    // new cross association:
    var crossAssociation = mendixmodelsdk_1.domainmodels.CrossAssociation.createIn(domainModel);
    crossAssociation.name = "CrossAssociation_2";
    crossAssociation.parent = entity1;
    crossAssociation.child = entity2;
    crossAssociation.type = mendixmodelsdk_1.domainmodels.AssociationType.ReferenceSet;
    return domainModel;
}
exports.createSmallDomainModel = createSmallDomainModel;
